  \"Population structure and genetic characteristics of summer steelhead (Onchorhynchus
  mykiss) in the Deschutes River Basin, Oregon: Final report: January 2011\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 7,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:48:45.215991\",\n\t\"name\": \"population-structure-and-genetic-characteristics-of-summer-steelhead-onchorhynchus-mykiss-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Deschutes River Basin represents a
  region of substantial diversity among anadromous and resident forms of Oncorhynchus
  mykiss. However, the current distribution and genetic origins of populations throughout
  the Deschutes River Basin have not been clearly delineated. Using a suite of 17
  microsatellite markers, we evaluated genetic structure among Deschutes River Basin
  populations of steelhead. To provide a broader perspective of diversity and to help
  assess the Interior Columbia River Technical Recovery Team (ICR-TRT) population
  delineations, we also compared the steelhead collections to collections of redband
  trout from the upper basin and the Oak Springs Hatchery rainbow trout stock that
  was planted in the Deschutes River Basin. Whychus Creek redband trout appeared to
  be more genetically similar to O. mykiss in the lower mainstem of the Deschutes
  River than to other collections included in this report, which is inconsistent with
  the previous population delineation that includes Whychus Creek with Deschutes-Westside
  populations. Below the Pelton-Round Butte Dam complex mainstem collections were
  statistically different from tributary collections; however, there were no statistically
  significant differences between Deschutes-Westside and Deschutes-Eastside populations
  below the Pelton-Round Butte Dam complex. These data suggest that the previous delineation
  of populations into Deschutes-Westside and Deschutes-Eastside by the ICR-TRT does
  not reflect observed genetic relationships.\",\n\t\"license_title\": \"License Not
